import { Button } from "@mui/material";
import React from "react";
import DropBoxCont from "./DropBox";
import Imdb from "./Imdb";
import { getMovies } from "./FireBase";

function App() {
  const dbxData = (data) => {
    console.log(data);
  };

  const imdbData = (data) => {
    console.log(data);
  };
  return (
    <>
      <DropBoxCont setData={dbxData} />
      <Imdb setData={imdbData} />
      <Button
        variant="contained"
        onClick={getMovies}
        sx={{ marginLeft: "100px", marginTop: "50px" }}
      >
        Add Entry to DataBase
      </Button>
    </>
  );
}

export default App;
